import React, { useState, useEffect } from "react";
import { Card, Button, Image, Header, Modal } from "semantic-ui-react";
import { connect } from "react-redux";
import { withRouter } from "react-router-dom";
import { setGroupBooks, setGroupUsers } from "../actions/group";

function GroupPage(props) {
  useEffect(() => {
    let groupBooks = null;
    let groupUsers = null;
    fetch(`http://localhost:3000/group/${props.group.id}`)
      .then((resp) => resp.json())
      .then((group) => {
        groupBooks = group.group_books;
        groupUsers = group.group_users;
      })
      .then(
          setGroupBooks
      );
  }, []);
  return (
    <div>
      <h1>hi</h1>
    </div>
  );
}

const mapStateToProps = (state) => {
  return {
    group: state.groups.group,
    groupBooks: state.groups.groupBooks,
    groupUsers: state.groups.groupUsers,
  };
};

const mapDispatchToProps = (dispatch) => {
  return {
    setGroupBooks: (group) => dispatch(setGroupBooks(group)),
    setGroupUsers: (group) => dispatch(setGroupUsers(group)),
  };
};

export default withRouter(
  connect(mapStateToProps, mapDispatchToProps)(GroupPage)
);
